import { withRouter } from 'next/router'

const Other = ({ router }) =>{
	// amp时自带固定的
	console.log(router)
	return (
		 <div>
		    Next stars: 
		    {router.query.amp.id}
		  </div>
	)
}




export default withRouter(Other)
